def all_combinations(submatches):
    """
    Combine the submatches in all possible ways. E.g., (+ #1 #2) and #1 can be combined
    as
        (+ #1 #2), #3 -- treating the second #1 independently of the first match
        (+ #1 #2), #1 -- treating the second #1 as the same as the first match's #1
        (+ #1 #2), #2 -- treating the second #1 as the same as the first match's #2

    We ensure that any introduced variable reuse is consistent.
    """
    # TODO actually do this. For now we just do not support variable reuse
    return [submatches]


def is_subset_tree(tree1, tree2):
    # print(tree1, tree2)
    if tree1.symbol.startswith("#"):
        return True
    if tree1.symbol != tree2.symbol:
        return False
    if len(tree1.children) != len(tree2.children):
        return False
    for child1, child2 in zip(tree1.children, tree2.children):
        if not is_subset_tree(child1, child2):
            return False
    return True


def update_matches(iteration, matches):
    new_matches = matches[:]

    for (symbol, arity), locations in symbol_to_location.items():
        child_locs_each = [
            {children_of[loc][idx] for loc in locations} for idx in range(arity)
        ]
        # print(symbol, arity, locations)
        all_submatches = itertools.product(
            *[
                [match for match in matches if child_locs_each[idx] & match.locations]
                for idx in range(arity)
            ]
        )
        all_submatches = [
            submatches_new
            for submatches in all_submatches
            for submatches_new in all_combinations(submatches)
        ]
        for submatches in all_submatches:
            if (
                not arity
                and iteration > 0
                or arity
                and all(match.iteration_added < iteration - 1 for match in submatches)
            ):
                # assert new_match in new_matches, new_match
                continue
            # print(submatches)
            locs = {
                loc
                for loc in locations
                if all(
                    child_loc in submatch.locations
                    for submatch, child_loc in zip(submatches, children_of[loc])
                )
            }
            if len(locs) < 2:
                continue
            # print(locs)
            new_match = Match(
                ns.SExpression(symbol, [submatch.tree for submatch in submatches]),
                locs,
                iteration,
            )
            new_matches.append(new_match)
    # new_matches = sorted(
    #     new_matches, key=lambda match: match.local_utility, reverse=True
    # )
    return sorted(pareto_optimize(new_matches), key=str)


def is_strictly_worse_than(match1, match2):
    return match1.locations.issubset(match2.locations) and is_subset_tree(
        match1.tree, match2.tree
    )


def pareto_optimize(new_matches):
    print("before: ", len(new_matches))
    new_matches = new_matches[:]
    for i in range(len(new_matches)):
        for j in range(len(new_matches)):
            if new_matches[i] is None or new_matches[j] is None:
                continue
            if i == j:
                continue
            if is_strictly_worse_than(new_matches[i], new_matches[j]):
                new_matches[i] = None
                # done = False
    new_matches = [match for match in new_matches if match is not None]
    print("after: ", len(new_matches))
    return new_matches


def main():
    start = time.time()
    matches: List[Match] = [Match(ns.SExpression("#0", ()), all_locations, -1)]
    for iteration in itertools.count():
        print(
            "ITERATION",
            iteration,
            len(
                [
                    (ns.render_s_expression(match.tree), match.locations)
                    for match in matches
                ]
            ),
        )
        matches_new = update_matches(iteration, matches)
        if matches_new == matches:
            break
        matches = matches_new
    print([(ns.render_s_expression(match.tree), match.locations) for match in matches])
    print("Time taken:", time.time() - start)


main()

